import React from "react";

export default class ContactDetails extends React.Component{
    render(){

        const details = (<div>
                            <p>{this.props.contact.name}</p>
                        </div>);
        const blank = (<div>Not Selected</div>);

        return (
            <div>
                {this.props.isSelected ? details : blank}
            </div>
        )
    }
}
